'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class SendLimitOrderForTradeCommand extends SendSingleCommandWithoutResponse {
    limitOrderRequest;
    openPosition;
    constructor() {
        super();
        this.commandName = "SendLimitOrderForTradeCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createLimitOrderForTradeRequestMessage(this.tradingSession, this.limitOrderRequest, this.openPosition, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = SendLimitOrderForTradeCommand
